local logoID = "rbxassetid://95689726591891"
local screenGui = Instance.new("ScreenGui", game.CoreGui)
screenGui.Name = "AnuraHubUI"
local toggleButton = Instance.new("ImageButton", screenGui)
toggleButton.Image = logoID
toggleButton.Size = UDim2.new(0, 200, 0, 300)
toggleButton.Position = UDim2.new(0, 10, 0.5, -150)
toggleButton.BackgroundTransparency = 1

-- FPS Boost
for _, obj in ipairs(workspace:GetDescendants()) do
    if obj:IsA("BasePart") and (obj.Name:lower():match("tree") or obj.Name:lower():match("grass") or obj.Name:lower():match("rock") or obj.Name:lower():match("ground")) then
        obj:Destroy()
    end
end

-- Aimbot chọn player gần nhất trong 6000 studs
function GetClosestPlayer()
    local closest, dist = nil, 6000
    for _, p in pairs(game.Players:GetPlayers()) do
        if p ~= game.Players.LocalPlayer and p.Character and p.Character:FindFirstChild("HumanoidRootPart") then
            local mag = (p.Character.HumanoidRootPart.Position - game.Players.LocalPlayer.Character.HumanoidRootPart.Position).Magnitude
            if mag < dist then
                closest = p
                dist = mag
            end
        end
    end
    return closest
end

-- Hitbox mở rộng
game:GetService("RunService").Heartbeat:Connect(function()
    for _, plr in pairs(game.Players:GetPlayers()) do
        if plr ~= game.Players.LocalPlayer and plr.Character and plr.Character:FindFirstChild("HumanoidRootPart") then
            local hrp = plr.Character.HumanoidRootPart
            hrp.Size = Vector3.new(50, 50, 50)
            hrp.Transparency = 0.7
            hrp.Material = Enum.Material.Neon
        end
    end
end)

